import React, { useState } from "react";
import InputTable from "./components/InputTable";
import "./App.css";

function App() {
  const [input1, setInput1] = useState("");
  const [input2, setInput2] = useState("");
  const [tableData, setTableData] = useState([]);
  const [tuitionState, setTuitionState] = useState("in-state"); // new state variable for tuition state

  const handleSubmit = ({ input1, input2 }) => {
    setTableData([...tableData, { input1, input2, tuitionState }]); // include tuitionState in table data
  };

  return (
    <div>
      <InputTable
        input1={input1}
        setInput1={setInput1}
        input2={input2}
        setInput2={setInput2}
        tuitionState={tuitionState}
        setTuitionState={setTuitionState} // pass state variable and setter function to SearchItems
        tableData={tableData}
        onSubmit={handleSubmit}
      />
    </div>
  );
}

export default App;
